const Header = () => {
  return (
    <div className="header">
      <h1>
        Short Film Festival
        <form action="/" method="get">
          <label htmlFor="header-search">
            <span className="visually-hidden"></span>
          </label>
          <input
            type="text"
            id="header-search"
            placeholder="Search Short Films"
            name="s"
          />
          <button type="submit">Search</button>
        </form>
      </h1>
    </div>
  );
};

export default Header;
